package loop;

import java.util.Scanner;

public class pattern_loop 
{

	public static void main(String[] args) 
	{
		// TODO Auto-generated method stub
		Scanner sc=new Scanner(System.in);
		int i,j;
		for(i=1;i<=5;i++)
		{
			for(j=1;j<=5;j++)
			{
				System.out.print("*");
			}
			System.out.println();
		}

	}

}
